//--- navigation functions ---//

function zoomed() {
	container.transition()
		.duration(500)
		.attr("transform", "translate(" + d3.event.translate + ")scale(" + d3.event.scale + ")");
}

//--- country functions ---//
function countryHover() {
	var countryPath = d3.select(this).select("path");
	var countryText = d3.select(this).select("text");
	var CountryCode = d3.select(this).select("code");

	//Gets the iso 2 digit country code
	infoCode = CountryCode.attr("code");
	
	// map changes
	infoText.select("text").text(countryText.attr("name"));
	infoText.select("rect").transition()
		.delay(200)
		.duration(500)
		.attr("width", 128+countryText.attr("name").length*7);
	infoText.transition()
	  	.duration(200)
	 	.style("fill-opacity", 1)
	  	.attr("transform", "translate(" + 50 + ",0)");	

	countryPath.transition()
		.duration(500)
		.style("fill", "steelblue");	
		//stroke causes lag
		
}

function countryOut() {
	var countryPath = d3.select(this).select("path");
	var countryText = d3.select(this).select("text");

	infoText.select("rect").transition()
		.delay(1500)
		.duration(1500)
		.attr("width", 0);
	infoText.transition()
	  	.duration(1500)
	 	.style("fill-opacity", 0)
	  	.attr("transform", "translate(" + -200 + ",0)");	

	countryPath.transition()
		.duration(500)
		.style("fill", "#ddd")		;
}

function countryClickedOn() {
	// map styles and function pointer
	var country = d3.select(this);

	countries.on("click", 0)
		.on("mouseover", 0)
		.on("mouseout", 0);

	country.attr("class", "selectedCountry")
		.style("fill", "steelblue");

	countries = d3.selectAll(".country");

	countries.transition()
		.duration(500)
		.style("fill-opacity", 0)
		.style("stroke-opacity", 0);

	country.attr("class", "country");

	// map and chart shift
	container.transition()
		.duration(600)
		.attr("transform", "translate(0,0.001)scale(1.001)");

	container.transition()
		.delay(600)
		.duration(2000)
		.attr("transform", "translate(0," + -MAP_HEIGHT + ")scale(1.001)");

	chart.transition()
		.delay(600)
		.duration(2000)
		.attr("transform", "translate(0,0)");

	country.select("path").transition()
		.delay(2000)
		.style("fill", "#ddd");

	// title
	infoText.transition()
		.delay(800)
		.duration(1000)
		.attr("transform", "translate(" + MAP_WIDTH/2 + ",0)");
	infoText.select("text").transition()
		.duration(1000)
		.attr("x", -infoText.select("text").text().length/4 + "em")
		.style("fill", "#FFF");
	infoText.select("rect").transition()
		.delay(800)
		.duration(1000)
		.attr("x", -infoText.select("text").text().length/2 + "em")
		.attr("width", infoText.select("text").text().length + "em")
		.attr("height", 4)
		.attr("rx", 1)
		.attr("ry", 1)
		.style("fill", "#FFF");

	//link to the json of number of Internet users
	var apiIntUsr =  "http://api.worldbank.org/countries/"+ infoCode +"/indicators/IT.NET.USER.P2?per_page=100&date=2014:2014&format=jsonP&prefix=getdata&callback=?";	

	var numUsers = 0;

	/* ajax api call with jquery (has to be in JSONP to avoid CORS),
		on success it draws it calls the draw pie function with the data*/
	$.ajax({
	   type: 'GET',
	    url: apiIntUsr,
	    dataType: 'json',
	    jsonpCallback: 'getdata',
	    success: function(data) {
	    	var countryName = infoText.select("text").text();
			console.log("Number of users in " + countryName + " " + data[1][0].value);
			numUsers = data[1][0].value;
			drawPie(numUsers);
	    },
	    error: function(e) {
	       console.log(e.message);
	    }
	});	
}

function countryClickedOff() {
	// map styles and function pointer
	container.transition()
		.delay(500)
		.duration(2000)
		.attr("transform", "translate(0,0.001)scale(1.001)"); // small difference needed because otherwise d3 would delete the scale string messing up all further animations
	chart.transition()
		.delay(500)
		.duration(2000)
		.attr("transform", "translate(0," + MAP_HEIGHT + ")");
	container.transition()
		.delay(2500)
		.duration(1000)
		.attr("transform", "translate(" + zoom.translate() + ")scale(" + zoom.scale() + ")");

	// map and chart shift
	countries = d3.selectAll(".country")
	countries.on("click", countryClickedOn)
		.on("mouseover", countryHover)
		.on("mouseout", countryOut);
	countries.transition()
		.delay(2400)
		.duration(500)
		.style("fill-opacity", 1)
		.style("stroke-opacity", 1);

	// title
	infoText.transition()
		.delay(800)
		.duration(1000)
		.style("fill-opacity", 0)
		.attr("transform", "translate(" + -200 + ",0)");
	infoText.select("text").transition()
		.delay(800)
		.duration(1500)
		.attr("x", 50)
		.style("fill", "#BEF");
		// .style("font-weight", 300);
	infoText.select("rect").transition()
		.delay(800)
		.duration(1500)
		.attr("x", -50)
		.attr("width", 0)
		.attr("height", 1)
		.attr("rx", 0)
		.attr("ry", 0)
		.style("fill", "#BEF");

	sections.each(arcVanish);
}

//--- chart and legend functions ---//

function drawPie(users) {
	chartData = [{name:"Internet users", value:users}, 
			{name:"Non internet users", value:(100 - users).toFixed(2)}];

	pieChart = chart.append("g")
		.attr("class", "pieChart")
		.attr("transform", "translate(" + (130+CHART_SIZE/2) + "," + CHART_SIZE + ")");

	chartText = pieChart.append("text")
		.attr("class", "chart-text")
		.attr("dx", -(chartData[0].value).toString().length/4 + "em") // centers the text indepentend of the world length
		.attr("dy", "+0.5em") // vertical centering 
		.text("");

	sections = pieChart.selectAll(".section")
			.data(pie(chartData)) // get the data from the pie chart layout created from our data
		.enter().append("g")
			.attr("class", "section");

	// mapping function which maps the given domain onto a range by a specified hsl interpolation method
	colorScale = d3.scale.linear()
		.domain([0, chartData.length])
		.range(["hsl(-180,50%,50%)", "hsl(180,50%,50%)"])
		.interpolate(interpolateHsl); // set interpolation function

	// add our arcs
	sections.append("path")
		.each(function(d) { // add outer radius var to data for transitions
			d.startA = d.startAngle;
			d.endA = d.endAngle;
			return d.outerRadius = radius;
		})
		.attr("d", arc) // arc as path attribute
		.style("fill", function(d,i) { return colorScale(i); })
		.on("mouseover", arcTweenOut)
		.on("mouseout", arcTweenIn);


	//--- legend ---//
	chartLegend = chart.append("g")
		.attr("class", "legend")
		.attr("transform", "translate(20," + CHART_SIZE/2 + ")");

	btnLegend = chartLegend.append("text")
		.attr("id", "btnLegend")
		.attr("y", "1em")
		.attr("cursor", "pointer")
		.text("Legend")
		.on("click", legendClicked);

	legend = chartLegend.append("g")
		.attr("class", "legend-entries")
		.attr("transform", "translate(0,40)");

	entries = legend.selectAll("g")
			.data(chartData)
		.enter().append("g")
			.attr("transform", function(d,i) { return "translate(20," + i*20 +")"; });

	entries.append("text")
		.attr("dx", 5)
		.style("fill", "#7A7A7A")
		.text(function(d)  { return d.name; })
		.on("mouseover", entryHover)
		.on("mouseout", entryOut);
	entries.append("rect")
		.attr("x", -10)
		.attr("y", -10)
		.attr("width", 10)
		.attr("height", 10)
		.attr("rx", 2)
		.attr("ry", 2)
		.attr("fill", function(d,i) { return colorScale(i); });

	sections.each(arcSpread);
}

function arcSpread(d) {
	var end = d.endA;
	d.startAngle = d.startA;
	d.endAngle = d.startA;

	var section = d3.select(this).select("path");
	section.attr("d", arc(d));

	section.transition()
		.delay(2300)
		.duration(2000)
		.ease("elastic")
		.attrTween("d", function(d) {
	      		var i = d3.interpolate(d.endAngle, end);
	      		return function(t) { d.endAngle = i(t); return arc(d); };
	      	});
}

function arcVanish(d) {
	var section = d3.select(this).select("path");

	section.transition()
		.duration(700)
		.ease("linear")
		.attrTween("d", function(d) {
	      		var i = d3.interpolate(d.startAngle, 0),
	      			j = d3.interpolate(d.endAngle, 0);
	      		return function(t) { d.startAngle = i(t); d.endAngle = j(t); return arc(d); };
	      	});
}

// arc in and arc out tween due to different color changes
function arcTweenOut(d,i) {
	chartText.text(d.data.value)
		.attr("dx", -(d.data.value).toString().length/4 + "em");

	var section = d3.select(this);

	section.style("fill", function(d) { return colorScale(i).darker(2); })
		.style("stroke", "#EEE")
		.style("stroke-width", "2.5px");

	section.transition()
		.duration(500)
		.ease("bounce", "in-out")
		.attrTween("d", function(d) {
      		var i = d3.interpolate(d.outerRadius, radius+20);
      		return function(t) { d.outerRadius = i(t); return arc(d); };
      	});

    var entry = d3.select(entries[0][i]).select("text");

    entry.transition()
    	.duration(250)
    	.style("fill", "#FFF");
}

function arcTweenIn(d,i) {
	chartText.text("");

	var section = d3.select(this);

	section.style("fill", colorScale(i))
		.style("stroke", "#333")
		.style("stroke-width", "1.5px");

	section.transition()
		.delay(150)
		.duration(500)
		.ease("bounce", "in-out")
		.attrTween("d", function(d) {
      		var i = d3.interpolate(d.outerRadius, radius);
      		return function(t) { d.outerRadius = i(t); return arc(d); };
      	});

    var entry = d3.select(entries[0][i]).select("text");

    entry.transition()
    	.duration(250)
    	.style("fill", "#7A7A7A");
}

// special interpolation method for hsl values to avoiding shortest-path interpolation
function interpolateHsl(a, b) {
  var i = d3.interpolateString(a, b);
  return function(t) {
    return d3.hsl(i(t));
  };
}

// pie chart converter so that the layout extracts the right values
function converter(d) {
	return +d.value; // force cast to number value, just in case
}

function legendClicked() {
	var x = d3.transform(entries.attr("transform")).translate[0];

	if(x <= 0) {
		entries.each(function(d,i) {
			var entry = d3.select(this);

			entry.transition()
				.delay(i*100)
				.duration(500)
				.ease("elastic")
				.attr("transform", "translate(" + 20 + "," + d3.transform(entry.attr("transform")).translate[1] + ")");
		});
	} else {
		entries.each(function(d,i) {
			var entry = d3.select(this);

			entry.transition()
				.delay(i*100)
				.duration(500)
				.ease("elastic")
				.attr("transform", "translate(" + -200 + "," + d3.transform(entry.attr("transform")).translate[1] + ")");
		});
	}
}

function entryHover(d,i) {
	chartText.text(d.value)
		.attr("dx", -(d.value).toString().length/4 + "em");

	var section = d3.select(sections[0][i]).select("path");

	section.style("fill", function(d) { return colorScale(i).darker(2); })
		.style("stroke", "#EEE")
		.style("stroke-width", "2.5px");

	section.transition()
		.duration(500)
		.ease("bounce", "in-out")
		.attrTween("d", function(d) {
      		var i = d3.interpolate(d.outerRadius, radius+20);
      		return function(t) { d.outerRadius = i(t); return arc(d); };
      	});

    var entry = d3.select(this);

    entry.transition()
    	.duration(250)
    	.style("fill", "#FFF");
}

